package week1.day1;

public class Chrome {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Float
		Float f1 = 91.0f;
		System.out.println("Float is:" + f1);
		
		//String
		String str1 = "Google";
		System.out.println("String is:" + str1);
		
		//boolean
		boolean bool = false;
		System.out.println("boolean is:" + bool);
		
		//integer
		int year = 2008;
		System.out.println("integer is:" + year);
		
		//character
		char ch = 'C';
		System.out.println("character is:" + ch);
		
	}

}
